import React, {Component} from 'react';
import {ABOUT_ME_TEXT} from "../config/configuration";

class AboutMe extends Component {
    render() {
        return (
            <div className={'about-me container-fluid'}>
                <div className={'container text-center'}>
                    <div className={'row'}>

                        <div className={'photo col-sm-12 col-md-6 offset-md-3 col-lg-4 offset-lg-4'}>

                        </div>
                        <div className={'row'}>
                            <div className={'col-sm-12 col-md-9 offset-md-1 '}>
                                <p className={'text'}>
                                    {ABOUT_ME_TEXT}
                                </p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default AboutMe;
